import React from "react";

const False=(prop)=>{
    let x=prop.x;

    let y = prop.y;

    let z= prop.z;
    return(
        <>
        <div>
            <h1>{x} {y}{z}</h1>
            <h1>this is notmatching</h1>
            <hr></hr>
        </div>
        
        </>
    )
}

export default False;
